import React from 'react';
import './LibraryCSS/Header.css';
import ProfilePic from './Images/profilePic.png'
import TripleLine from './Images/TripleLine.png'


function LibraryHeading() {

  return (
      <div className="LibraryRow">
        <button id="LeftImage">
          <image src={TripleLine} id="tripleImage"/>
        </button>
        <div className="LibraryHeader-Middle">
          <p>Library</p>
        </div>
        <a href="/">
          <button>
            <image src={ProfilePic} id="ProfileImage"/>
          </button>
        </a>
      </div>
  );
}

export default LibraryHeading;
